        <div className= 'container' >
            <div className={`p-3 bg-${col[0]} bg-opacity-10  border-info  rounded-end`}>
                <h5 className=''>{note.Title}</h5>
                <p >{note.Description}</p>
            </div>
        </div>


    )
}

